$(document).ready(function(){
  $('#notifications').on("click", function() {
    var read_at = Date($.now());
    var notification_ids = $('#notification').val();
    $('.badgeAlert').remove();
    var data = Map(notification_ids.map(i => [i, read_at]));
    alert(data);
    $.ajax({
      type: 'GET',
      url: '/notifications',
      data: {data: data}
    });
  })
})
